import React, {useState, useEffect} from "react";
import styles from "./ContainerCard.module.scss";
import Link from "next/link";
import {useRouter} from "next/router";

let initialState = {
  container: null,
};

export function ContainerCard({container}) {
  const routerObject = useRouter();
  const location = routerObject.query.location;
  console.log(container);
  const [state, setState] = useState(initialState);
  let box = null;

  useEffect(() => {
    async function wait() {
      setState({...state, container: box});
    }
  }, [container]);

  return (
    <div className={styles.container}>
      <img className={styles.containerImg} src="/static/images/container.svg" alt="illustration container" />
      <div className={styles.type}>
        <h1>Container </h1>
      </div>

      <div className={styles.PriceWrapper}>
        <h2 className={styles.h2}>{state.container.m2}kvm</h2>
        <h2 className={styles.h2}>{state.container.price}/m√•n</h2>
      </div>

      <Link href="/container/[location]/[containerForm]" as={`/container/${location}/${state.container._id}`}>
        <button className={styles.button}>Boka</button>
      </Link>
    </div>
  );
}
